async function gerarPDF() {
  const { jsPDF } = window.jspdf
  const doc = new jsPDF("landscape")

  // Exemplo de logo base64 (substitua pelo seu)
  const logoBase64 =
    "data:image/png;base64,"

  // === Cabeçalho só na primeira página ===

  // === Cabeçalho dinâmico ===
  const meses = ["Janeiro", "Fevereiro", "Março", "Abril", "Maio", "Junho", "Julho", "Agosto", "Setembro", "Outubro", "Novembro", "Dezembro"]
  const hoje = new Date()
  const mes = meses[hoje.getMonth()]
  const ano = hoje.getFullYear()
  const periodo = `Período de inspeção: ${mes}/${ano}`
  doc.addImage(logoBase64, "PNG", 5, 2, 25, 20)

  doc.setFontSize(18)
  doc.text("Relatório de Extintores", doc.internal.pageSize.getWidth() / 2, 10, { align: "center" })

  doc.setFontSize(11)
  doc.text(periodo, doc.internal.pageSize.getWidth() / 2, 20, { align: "center" })

  // === Tabela ===
  doc.autoTable({
    html: "#tabela",
    startY: 22, // primeira página começa mais abaixo
    margin: { top: 5, left: 5, right: 5 }, // usado da 2ª página em diante
    styles: {
      font: "helvetica",
      fontSize: 8,
      cellPadding: 1,
      halign: "center",
    },
    headStyles: {
      fillColor: [0, 51, 102], // azul escuro
      textColor: 255,
      halign: "center",
      fontStyle: "bold",
    },
    bodyStyles: {
      textColor: [0, 0, 0],
      fillColor: [255, 255, 255],
    },
    alternateRowStyles: {
      fillColor: [230, 240, 255], // azul claro
    },
  })

  // === Salvar PDF ===

  const agora = new Date()
  const dataHora = agora.toLocaleString("pt-BR").replace(/[\/,: ]/g, "-")
  const nomeArquivo = `Relatorio_Extintores_${dataHora}.pdf`

  doc.save(nomeArquivo)

  document.querySelector(".success-message").innerHTML = "<p> Relatório Gerado com Sucesso! </p>"
}
